import React,{ Component } from 'react';

class ProductNew extends Component {
    constructor() {
        super();
        this.state = {
            stock: '',
            brand: '',
        }
        this.stock = this.stock.bind(this);
        this.brand = this.brand.bind(this);
    }
    stock(Event){
        this.setState({
            stock: Event.target.value
        });
        console.log("Hello Stock");
    }
    brand(Event){
        this.setState({
            stock: Event.target.value
        });
        console.log("Hello Brand");
    }
    render() {
        return(
            <div className="dchannel-content productnew">
                <div style={{ padding: "10px"}}>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Stock</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text" onChange={this.stock}/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Brand</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text" onChange={this.brand}/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Type</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text"/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Price</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text" />
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6 text-right">
                            <button className="btn btn-gray" onClick={this.newProduct}>SAVE</button>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
export default ProductNew;
